import pic from '../../pic/quiz.png'
import './Home.css'

const Home = () => {
    return (
        <div>
           <div className="banner_img">
           <img src={pic} alt="" />
           </div>
           <div className='banner_info'>

           </div>
        </div>
    );
};

export default Home;
